import style from './Category.module.css'
import Category_container from './Category_container'

function Category({textChanged}) 
{
    return (
        <div className={style.container}>
            <Category_container delay={0} isVisible={textChanged}>2022</Category_container>
            <Category_container delay={0.5} isVisible={textChanged}>2021</Category_container>
            <Category_container delay={1} isVisible={textChanged}>2020</Category_container>
            <Category_container delay={1.5} isVisible={textChanged}>2019</Category_container>
        </div>
    );
}

export default Category;
